import React from "react";

const TopBar = () => {
    return (
        <React.Fragment>
            <input id="search_for_coin_input" placeholder="Search for coin"></input>
                <p id="top_bar_text">Want access to more data? The ability to customise parameters such as moving averages and
                    exchanges? <br/>Sign up and get access to all of these features and more!</p>
            <button id="settings_button" className="button_primary">Settings</button>
        </React.Fragment>
    );
};

export default TopBar;
